import React from "react";

import { ReactComponent as Sunny } from "./Sunny.svg";
import { ReactComponent as Windy } from "./windy.svg";
import { ReactComponent as Rainy } from "./Rainy.svg"

function iconMapper(weatherType) {
    switch (weatherType) {
        case 'Clear':
            return <Sunny/>;
        case 'Rain':
            return <Rainy/>;
        case 'Mist':
            return <Windy/>;

    }
}

export default iconMapper;
